import React from "react";
import styled from "styled-components";

const BackBlock = styled.div`
  background-color: black;
  position: absolute;
  width: 100%;
  height: 100%;
  margin: 0 auto;
`;

const ManageTemplate = () => {
  return <BackBlock></BackBlock>;
};

export default ManageTemplate;
